class App extends Component {
	render() {
		return (
		<React.Fragment>
		<Router>
			<Switch>
				<Route exact path="/" component={Home} />
				<Route exact path="/about" component={About} />
				<Route exact path="/contact" component={About} />
				<Route component={NoMatch} />
			</Switch>
		</Router>
		</React.Fragment>
	);}
}

export default App;
